import React from "react";
import { Link } from "react-router-dom";
export default function home() {
    return (
      <div>
      <h1>This is the home page</h1>
      <Link to="add">Click to view our about page</Link>
      <Link to="delete">Click to view our contact page</Link>
      <Link to="update">Click to view our contact page</Link>
      <Link to="delete">Click to view our contact page</Link>
    </div>
 
  );
}
